import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import { AuthContextProvider } from './context/AuthContext';
import Router from './Router';

class App extends Component {
  render() {
    return (
      <AuthContextProvider>
        <Router/>
      </AuthContextProvider>
    );
  }
}

export default App;
